  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Sortable Table</title>
  <link href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css" rel="stylesheet">
  <style>
    th {
      cursor: pointer;
    }
  </style>
</head>
<body>

<div class="container mt-5">
  <table class="table table-bordered" id="sortableTable">
    <thead>
      <tr>
        <th onclick="sortTable(0)">Name</th>
        <th onclick="sortTable(1)">Age</th>
        <th onclick="sortTable(2)">Country</th>
      </tr>
    </thead>
    <tbody>
      <tr>
        <td>John Doe</td>
        <td>28</td>
        <td>USA</td>
      </tr>
      <tr>
        <td>Jane Smith</td>
        <td>34</td>
        <td>Canada</td>
      </tr>
      <tr>
        <td>Mike Johnson</td>
        <td>22</td>
        <td>UK</td>
      </tr>
    </tbody>
  </table>
</div>

<script>
  function sortTable(n) {
    const table = document.getElementById("sortableTable");
    let rows, switching, i, x, y, shouldSwitch, dir, switchcount = 0;
    switching = true;
    dir = "asc";

    while (switching) {
      switching = false;
      rows = table.rows;

      for (i = 1; i < (rows.length - 1); i++) {
        shouldSwitch = false;
        x = rows[i].getElementsByTagName("TD")[n];
        y = rows[i + 1].getElementsByTagName("TD")[n];

        if (dir == "asc") {
          if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
            shouldSwitch = true;
            break;
          }
        } else if (dir == "desc") {
          if (x.innerHTML.toLowerCase() < y.innerHTML.toLowerCase()) {
            shouldSwitch = true;
            break;
          }
        }
      }

      if (shouldSwitch) {
        rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
        switching = true;
        switchcount++;
      } else {
        if (switchcount == 0 && dir == "asc") {
          dir = "desc";
          switching = true;
        }
      }
    }
  }
</script>

</body>
</html>
```

In this example:

- The `sortTable` function takes the column index (`n`) as an argument.
- The function sorts the table rows based on the content of the specified column.
- The sorting direction toggles between ascending and descending each time a header is clicked.

This approach uses plain JavaScript to handle the sorting logic and does not require any external libraries or plugins.

Certainly! Compiler optimization techniques are crucial for improving the performance of code by making it more efficient. Here are a few popular compiler optimization techniques with example codes:

### 1. Loop Unrolling
Loop unrolling reduces the overhead of loop control by duplicating the loop body multiple times.

**Example:**

Original Code:
```c
for (int i = 0; i < 10; i++) {
    array[i] = i * 2;
}
```

Optimized Code (Unrolled Loop):
```c
for (int i = 0; i < 10; i += 2) {
    array[i] = i * 2;
    array[i + 1] = (i + 1) * 2;
}
```

### 2. Inlining
Inlining replaces function calls with the actual function code to eliminate the overhead of function calls.

**Example:**

Original Code:
```c
int add(int a, int b) {
    return a + b;
}

int main() {
    int x = 5, y = 10;
    int result = add(x, y);
    return result;
}
```

Optimized Code (Inlined Function):
```c
int main() {
    int x = 5, y = 10;
    int result = x + y;
    return result;
}
```

### 3. Constant Folding
Constant folding evaluates constant expressions at compile time rather than at runtime.

**Example:**

Original Code:
```c
int main() {
    int x = 5 + 10;
    return x;
}
```

Optimized Code (Constant Folded):
```c
int main() {
    int x = 15;
    return x;
}
```

### 4. Dead Code Elimination
Dead code elimination removes code that does not affect the program's output.

**Example:**

Original Code:
```c
int main() {
    int x = 5;
    int y = 10;
    int z = x + y;
    return x;
}
```

Optimized Code (Dead Code Eliminated):
```c
int main() {
    int x = 5;
    return x;
}
```

### 5. Common Subexpression Elimination
