    char ch = toupper(Serial.read());
    if (ch >= 'A' && ch <= 'Z') {
      playMorse(morseAlphabet[ch - 'A']);
    } else if (ch == ' ') {
      delay(7 * dotDuration); // word space
    }
  }
}

void playMorse(const char* morse) {
  for (int i = 0; morse[i] != '\0'; i++) {
    if (morse[i] == '.') {
      playDot();
    } else if (morse[i] == '-') {
      playDash();
    }
    delay(dotDuration); // symbol space
  }
  delay(3 * dotDuration); // letter space
}

void playDot() {
  tone(buzzerPin, 1000, dotDuration);
  delay(dotDuration);
}

void playDash() {
  tone(buzzerPin, 1000, 3 * dotDuration);
  delay(3 * dotDuration);
}
